import { Menu } from 'antd';
import Dropdown from '../styled/Dropdown.styled';

export default function Jobs()
{
	return (
		<div className="job-search">
			<Dropdown placeholder="languages">
				<option value="" disabled selected hidden>Choose Location</option>
				<option value="">Abudhabi</option>
				<option value="">Al Ain</option>
				<option value="">Dubai</option>
				<option value="">Fujairah</option>
				<option value="">Ras al Khaima</option>
				<option value="">Sharjah</option>
				<option value=""></option>
			</Dropdown>
			<div className='choose-'>
				<h1>Choose job</h1>
			</div>
		</div>
	);
};
